const ImageGridListStyle = theme => ({
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	    backgroundColor: theme.palette.background.paper,
	},
	gridList: {
		'&::after': {
			padding: "20px",
			'& img': {
				height: "100%"
			}
		},
	},
});

export default ImageGridListStyle;
